{
	Point a,b,c;
	float angles[3]; float holder;
	int counterA, counterB;
	int result=1;
	char inA[6], inB[6], inC[6], inD[6], inE[6], inF[6];
	FILE *handle;

	int hits, misses, counter;
	hits=misses=0;

	handle = fopen ("triangles.tab", "r");
	while (result!=EOF) 
	{
		// Initialize arrays ever time
		for (counter=0; counter<6; counter++)
		{inA[counter]='\0';inB[counter]='\0';inC[counter]='\0';
		inD[counter]='\0';inE[counter]='\0';inF[counter]='\0';}

		result = fscanf(handle, "%s %s %s %s %s %s", inA, inB, inC, inD, inE, inF);
		if (result==EOF){break;}

		a.x=atoi(inA); a.y=atoi(inB);
		b.x=atoi(inC); b.y=atoi(inD);
		c.x=atoi(inE); c.y=atoi(inF);

		angles[0]=atan2(a.x, a.y)+PI; 
		angles[1]=atan2(b.x, b.y)+PI; 
		angles[2]=atan2(c.x, c.y)+PI;


		// Quick bubblesort of angles
		for (counterA=0; counterA<3; counterA++)
		{
		for (counterB=counterA; counterB<3; counterB++)
		{
			if (angles[counterA]>angles[counterB])
			{holder=angles[counterA]; angles[counterA]=angles[counterB]; angles[counterB]=holder;}
		}
		}

		// No delta between angles can be over PI radians
		if (angles[1]-angles[0]<PI 
			&& angles[2]-angles[1]<PI 
			&& angles[2]-angles[0]>PI)
			{ hits++;}
		else 	{ misses++;}
	}
	printf ("Hits: %d\tMisses: %d\n", hits, misses);
	return 0;
}

