{
    int i, compteur = 0;
    float area_a,area_b,area_c;
    Triangle Tri[1000];
    float Triangle_Area[1000];

    FILE * pFile;
    pFile = fopen("triangles.txt", "rt");
    if (pFile == NULL)
    {
        printf("Something is Wrong");
        return 0;
    }

    for(i = 0; i < 1000; i++)
    {
    fscanf(pFile, "%d,%d,%d,%d,%d,%d", &Tri;[i].PointA.x, &Tri;[i].PointA.y, &Tri;[i].PointB.x, &Tri;[i].PointB.y, &Tri;[i].PointC.x, &Tri;[i].PointC.y);
    //printf("%d %d %d %d %d %d\n", Tri[i].PointA.x, Tri[i].PointA.y, Tri[i].PointB.x, Tri[i].PointB.y, Tri[i].PointC.x, Tri[i].PointC.y);
    }
    for (i = 0; i < 1000; i++)
    {
        Triangle_Area[i] = (int)abs(Tri[i].PointA.x*(Tri[i].PointB.y - Tri[i].PointC.y) + Tri[i].PointB.x*(Tri[i].PointC.y - Tri[i].PointA.y) + Tri[i].PointC.x * (Tri[i].PointA.y - Tri[i].PointB.y))/2.0;
        }
    for (i = 0; i < 1000; i++)
    {
        area_c = abs(Tri[i].PointA.x*(Tri[i].PointB.y - 0) + Tri[i].PointB.x * (0 - Tri[i].PointA.y))/2.0;
        area_b = abs(Tri[i].PointA.x*(0 - Tri[i].PointC.y) + Tri[i].PointC.x * (Tri[i].PointA.y - 0))/2.0;
        area_a = abs(Tri[i].PointB.x*(Tri[i].PointC.y - 0) + Tri[i].PointC.x * (0 - Tri[i].PointB.y))/2.0;
        if (Triangle_Area[i] == (area_a + area_b + area_c))
        {
            printf("%d %d %d %d\n", Triangle_Area[i],area_a , area_b , area_c );
            compteur++;
        }
    }
    fclose(pFile);

    return compteur;


}

